const Filmlist = (props) => {
    console.log(props)
    let films = props.films.map((item,index) => {
        return <h3>{item.title}</h3>
    })
    let filmro = <div className="row">
    {this.props.objectInfo.map(element => 
    <Column title={element.title} objectInfo={element.desc}></Column>)}
    </div>
    let img = props.films.map((item,index) => {
        return <img src={item.poster_path}/>
    })
    return (
        <div className="film-list">
        <h1 className="section-title">FILMS</h1>
        <div className="row">
            {films}
            {img}
        </div>
        </div>
    )
}

export default Filmlist
